import React from 'react';
import { BrowserRouter,Route,Routes } from 'react-router-dom';
import Main from './screen/main';
import './screen/main/main.ccs'
const Base = () => {
    return(
        <>
        <div className='component'>
        <BrowserRouter>
        <Routes>
            <Route path='/' element={<Main/>}/>
        </Routes>
        </BrowserRouter>
        </div>
        </>
    )
}

export default Base;
